import React from "react";
import Footer from "../../components/Footer";
import Header from "../../components/Header";

import { Container, Wrapper } from "./styles";

const Pagamento: React.FC = () => {
  return (
    <Container>
      <Header />
      <Wrapper />

      <Footer />
    </Container>
  );
};

export default Pagamento;
